import{_ as o,c as d,o as c,ae as l}from"./chunks/framework.Dh1jimFm.js";const _=JSON.parse('{"title":"高阶玩法","description":"","frontmatter":{},"headers":[],"relativePath":"others/high-level-play.md","filePath":"others/high-level-play.md","lastUpdated":1771563132000}'),a={name:"others/high-level-play.md"};function i(t,e,r,s,n,p){return c(),d("div",null,e[0]||(e[0]=[l('<h1 id="高阶玩法" tabindex="-1">高阶玩法 <a class="header-anchor" href="#高阶玩法" aria-label="Permalink to &quot;高阶玩法&quot;">​</a></h1><h2 id="指定调用的-token-类型" tabindex="-1">指定调用的 token 类型 <a class="header-anchor" href="#指定调用的-token-类型" aria-label="Permalink to &quot;指定调用的 token 类型&quot;">​</a></h2><ol><li><p>程序的所有平台只有 7 种类型，分别是：<code>free</code>、<code>plus</code>、<code>pro</code>、<code>team</code>、<code>max</code>、<code>business</code>、<code>ultra</code></p></li><li><p>添加 token 的时候如果不指定类型，程序都会去调用各个平台的接口查询 token 的类型并添加到数据库中</p></li><li><p>调用接口的时候都是从数据库抽取 <code>随机类型</code> 的 token 进行请求的，如果你在调用模型的时候需要指定程序选取何种类型的 token，你可以通过调整模型名称进行类型的指定，<strong>模型名称</strong> 的格式为：<code>模型名称|[类型,...]</code>，比如：</p><ul><li><code>gpt-4o|[free]</code>：调用此模型只会从数据库中轮训 <code>free</code> 类型的 token</li><li><code>gpt-4o|[plus,pro]</code>：调用此模型只会从数据库中轮训 <code>plus</code> 和 <code>pro</code> 类型的 token</li></ul></li></ol><h2 id="模型参数" tabindex="-1">模型参数 <a class="header-anchor" href="#模型参数" aria-label="Permalink to &quot;模型参数&quot;">​</a></h2><p>模型参数是指可以在模型名称后添加平台支持的参数，通过这种方式可以灵活地通过模型名称来控制模型的功能和表现。</p><ul><li>格式：<code>模型名称-[参数1]-[参数2]-...</code></li><li>参数无前后顺序的要求，但必须在对应平台支持的合法取值范围内</li></ul><p>例如：<code>sora_video2</code> 支持 <code>10s</code>、<code>15s</code>、<code>25s</code>、<code>pro</code>、<code>hd</code>等参数，那么你可以通过模型参数来指定模型的生成能力，例如：</p><ul><li><code>sora_video2-10s-15s</code>：❌ 参数 &#39;10s&#39; 和 &#39;15s&#39; 不能同时使用</li><li><code>sora_video2-30s</code>：❌ 参数 &#39;30s&#39; 不存在</li><li><code>sora_video2-15s</code>：✅</li><li><code>sora_video2-25s-pro</code>：✅</li><li><code>sora_video2-pro-25s</code>：✅</li><li><code>sora_video2-hd-25s</code>：✅</li></ul>',8)]))}const u=o(a,[["render",i]]);export{_ as __pageData,u as default};
